import React from 'react';

const Sidebar = ({ user }) => {
    return (
        <div className="sidebar">
            <h2>Conversations</h2>
            <div className="user">
                <img src={user.avatar} alt={user.name} />
                <span>{user.name}</span>
            </div>
        </div>
    );
};

export default Sidebar;
